import "./Product.css";

function Product({title, image, price, ration}) {
  return (
    <div className="product">
      <div className="product__info">
        <p>Book 1</p>
        <p className="product__price">
          <small>$</small>
          <strong>19.99</strong>
        </p>

        <div className="product__rating">
          <p>⭐</p>
          <p>⭐</p>
          <p>⭐</p>
        </div>
      </div>

      <img
        src="https://rmnetwork.org/newrmn/wp-content/uploads/2011/11/generic-book-cover.jpg"
        alt=""
      ></img>

      <button>Add To Basket</button>
    </div>
  );
}

export default Product;
